using namespace std;



vector<int> pvi(const std::string& v){


    vector<int> ret;

    int prevStart = -1;
    for(int i=0;i<v.size();++i){

        if((v[i] == '[') || (v[i] == ' ')){
            continue;
        }

        if((v[i] == ']') || (v[i] == ',')){
            stringstream ss;
            ss<< v.substr(prevStart, i-prevStart);
            int value;
            ss>>value;
            ret.push_back(value);
            prevStart = -1;
            continue;
        }

        if(prevStart == -1){
            prevStart = i;
            continue;
        }
    }


    return ret;
}

vector<vector<int>> pvvi(const std::string& v){

    vector<vector<int>> ret;

    for(int i = 1;i< v.size();){
        
        if(v[i] == '['){
            int closePos = v.find(']',i+1);
            assert(closePos != string::npos);
            ;
            auto sub = pvi(v.substr(i, closePos-i+1));
            ret.push_back(sub);
            i = closePos + 2;
            continue;
        }
    }

    return ret;
}


class Solution {
public:
    vector<int> leftmostBuildingQueries(vector<int>& heights, vector<vector<int>>& queries) {

        map<pair<int,int>, int> cache;


        vector<pair<int,int>> sorted;
        sorted.resize(heights.size());
        for(int i =0 ;i<heights.size();++i){

            sorted[i].first = heights[i];
            sorted[i].second = i;
        }
        sort(sorted.begin(),sorted.end());

        vector<int> maxReach;
        maxReach.resize(heights.size());
        for(int i=0;i<heights.size();++i){
            auto searchStart = upper_bound(sorted.begin(),sorted.end(),pair<int,int>{heights[i],numeric_limits<int>::max()});

            maxReach[i] = i;
            for(auto p = searchStart;p!=sorted.end();++p){
                if(p->second > i){
                    maxReach[i] = max(p->second, maxReach[i]);
                }
            }
        }


        vector<int> ret;
        ret.resize(queries.size());

        for(int i=0;i<queries.size();++i){

            int p0= queries[i][0];
            int p1= queries[i][1];
            if(p0 == p1){
                ret[i ]= p0;
                continue;
            }

            int smallIdx = min(p0,p1);
            int bigIdx = max(p0,p1);
            auto cachePos = cache.find({smallIdx,bigIdx});
            if(cachePos != cache.end()){
                ret[i] = cachePos->second;
                continue;
            }

            int h0 = heights[p0];
            int h1 = heights[p1];

            if(heights[bigIdx] > heights[smallIdx]){
                ret[i] = bigIdx;
                continue;
            }

            //quick test if can't overlap
            if(max(p0,p1)> min(maxReach[p0],maxReach[p1])){
                ret[i] = -1;
                continue;
            }


            auto pos = find_if(heights.begin()+max(p0,p1), heights.end(), [=](auto v){
                return v > max(h0,h1);
            });

            if(pos == heights.end()){
                ret[i] = -1;
            }else{
                ret[i] = pos - heights.begin();
            }
            cache[{smallIdx, bigIdx}] = ret[i];
        }
        

        return ret;
    }

    int recFind(const vector<int>& heights, int left, int right,
                map<pair<int,int>, int>& cache){

        if(left == right){
            return left;
        }

        int small = min(left,right);
        int big = max(left, right);
        auto pos = cache.find({small, big});

        if(pos != cache.end()){
            return pos->second;
        }

        // always try from left
        //
        int best = numeric_limits<int>::max();
        for(int tryNext = small + 1; tryNext < heights.size(); ++ tryNext){
            if(heights[tryNext]<= heights[small]){
                continue;
            }
            int thisRes = recFind(heights, tryNext, big,cache);
            if(thisRes > 0){
                best = min(best, thisRes);
            }

        }

        best = (best == numeric_limits<int>::max()? -1: best);
        cache[{small,big}] = best;
        return best;
    }
};

